import React from "react";
import "./Chart.css";

class Chart extends React.Component {
 
  render() {
    return (
     <div>
       <h1>Line Graph with Raphael.js</h1>
       <div id="line-graph" class="line-graph"></div>
     </div>
    )
  }
}
export default Chart;
